import React from 'react';
import './Boxes.css';

const Boxes = ({box}) => {
    console.log(box)
    // [0].region_info.bounding_box
    return(
        <div 
            className='peter' 
            style={{
                top:box.topRow, 
                right: box.rightCol, 
                left: box.leftCol, 
                bottom:box.bottomRow
            }}
        ></div>
    )
} 

export default Boxes;
